import './AboutSub3.css';

function AboutSub3(){
    return(
        <>
        <div className='branches1'>
        <div className='branch1'>
        <img className='branchImg' src="aboutFiles/download (3).jpeg" alt="" />
        <p className='branchP1'>Bangalore</p>
        <p className='branchP2'>32, ELITE BANARAS, Gandhi Bazaar Main Rd, Gandhi Bazaar, Basavanagudi, Bengaluru, Karnataka 560004</p>
        </div>
        </div>
        </>
    )
}

export default AboutSub3;
